import React from 'react';
import TableRow from './TableRow';

const TableHeader = (props) => {


  const rowData = props.data.map((item) => {
    return (
      <TableRow data={item} />
    );
  });

  return (
    <div>
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>
      {rowData}
    </div>
  );
};

export default TableHeader;
